import{_ as e,o as a,c as r,e as t}from"./app.acfc35a6.js";const d={},h=t('<h1 id="说说-export-和-export-default-的区别" tabindex="-1"><a class="header-anchor" href="#说说-export-和-export-default-的区别" aria-hidden="true">#</a> 说说 export 和 export default 的区别</h1><h2 id="解释一" tabindex="-1"><a class="header-anchor" href="#解释一" aria-hidden="true">#</a> 解释一：</h2><h3 id="_1-相同点" tabindex="-1"><a class="header-anchor" href="#_1-相同点" aria-hidden="true">#</a> 1. 相同点</h3><p>export 与 export default 均可用于导出常量、函数、文件、模块等</p><h3 id="_2-不相同点" tabindex="-1"><a class="header-anchor" href="#_2-不相同点" aria-hidden="true">#</a> 2. 不相同点</h3><h4 id="_2-1-一个多个区别" tabindex="-1"><a class="header-anchor" href="#_2-1-一个多个区别" aria-hidden="true">#</a> 2.1 一个多个区别</h4><p>一个文件或者模块中，export 可以多个，export default 只能有一个</p><h4 id="_2-2-是否要大括号" tabindex="-1"><a class="header-anchor" href="#_2-2-是否要大括号" aria-hidden="true">#</a> 2.2 是否要大括号</h4><p>export 导出，需要 import {xxx，xxx，xxx} 导入，要大括号 export default 导出，需要 import xxx 导入，不要大括号</p><h4 id="_2-3-是否可以改名" tabindex="-1"><a class="header-anchor" href="#_2-3-是否可以改名" aria-hidden="true">#</a> 2.3 是否可以改名</h4><p>export 导出，import {xxx，xxx，xxx} 导入的时候不能改名字 export default 导出，import xxx 导入的时候可以改名字</p><h2 id="解释二" tabindex="-1"><a class="header-anchor" href="#解释二" aria-hidden="true">#</a> 解释二:</h2><h3 id="_1-相同点-1" tabindex="-1"><a class="header-anchor" href="#_1-相同点-1" aria-hidden="true">#</a> 1. 相同点</h3><p>这两个命令都是 ES6 提供的模块化语法，用于模块中内容的导出。</p><h3 id="_2-不同点。" tabindex="-1"><a class="header-anchor" href="#_2-不同点。" aria-hidden="true">#</a> 2. 不同点。</h3><ul><li>一个模块中，export 可以多个，export default 只能有一个</li><li>export 导出需要大括号，export default 导出不需要</li><li>export 导出可以利用 as 改名，export default 导出可定义别名来接收数据</li></ul>',16),x=[h];function i(o,n){return a(),r("div",null,x)}const l=e(d,[["render",i],["__file","20.说说export和export default的区别.html.vue"]]);export{l as default};
